import React from 'react'
import { Link } from 'react-scroll'

const Navbar = () => (

    <header className="sans-serif">
        <div className="cover  bg-center-l"  style={{ backgroundColor: 'rgba(0, 50, 50, 0.5)'}} >
            <div className="  " >
                <nav className="dt w-100 mw8 center">
                    <div className="dtc v-mid tr pa3">
                        <Link
                            activeClass="active"
                            to="about"
                            spy={true}
                            smooth={true}
                            offset={0}
                            duration={500}
                            className="f4 grow fw4 hover-orange no-underline white-70 dn dib-ns pv2 ph3" >About
                        </Link>
                        <Link
                            activeClass="active"
                            to="projects"
                            spy={true}
                            smooth={true}
                            offset={0}
                            duration={600}
                            className="f4 fw4 grow hover-orange no-underline white-70 dn dib-ns pv2 ph3" >Project
                        </Link>
                        <Link
                            activeClass="active"
                            to="resume"
                            spy={true}
                            smooth={true}
                            offset={0}
                            duration={800}
                            className="f4 fw4 grow hover-orange no-underline white-70 dn dib-ns pv2 ph3" >Resume
                        </Link>
                        <Link
                            activeClass="active"
                            to="contact"
                            spy={true}
                            smooth={true}
                            offset={0}
                            duration={1000}
                            className="f4 fw4 grow  hover-orange no-underline white-70 dn dib-ns pv2 ph3" >Contact
                        </Link>                      
                    </div>
                </nav>
            </div>
        </div>
    </header>
);


export default Navbar;
